import React, { Component } from 'react'


export default class LevelTwoOnePage extends Component {

  constructor(props) {
    super(props);
    this.state = {
      listResult: []
    }
  }
  async componentWillMount() {
    await this.loadData();
  }
  loadData = async () => {
     try {
      const options = {
        'method': 'GET',
        'Content-Type': 'application/json'
      }
      let res = await fetch('https://xbot.com.vn/standards.json', options)
      if (res) {
        let data = await res.json();
        this.setState({
          listResult: data
        })
      }
     } catch (error) {
       console.log(error);

     }
  }
  render() {
    console.log(this.state.data)
    return (


      <div>
        <h1>
          OnePage
         </h1>
      </div>
    )

  }
}
